import React, { Component } from 'react'
import './style.css';

class AppHeader extends Component {

    render() {
        // console.log(this.props);
        console.log("hi");
        return(
            <div className="header">
                <img src="https://github.com/gautam-in/shopping-cart-assignment/blob/master/static/images/logo.png?raw=true" alt="logo"/>
                <div className="left-nav">
                    <a href="google.com" id="home" className="nav-links">Home</a>
                    <a href="google.com" id="products" className="nav-links">Products</a>
                </div>
                <div className="right-nav">
                    <a href="google.com" id="signin" className="nav-right-links">SignIn</a>
                    <a href="./register/" id="register" className="nav-right-links">Register</a>
                    <div className="cart">
                        <img src="https://raw.githubusercontent.com/gautam-in/shopping-cart-assignment/0df6028eb9d9b295564ec4dad22265e56127655f/static/images/cart.svg" alt="cart-logo"/>
                        0 items
                    </div>
                </div>
            </div>
        )
    }
}

export default AppHeader;
